[{"location":"index.html#EconometricsLH","page":"EconometricsLH","title":"EconometricsLH","text":"","category":"section"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"CurrentModule = EconometricsLH","category":"page"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"This package contains general purpose code related to regressions and their display.","category":"page"},{"location":"index.html#RegressorInfo","page":"EconometricsLH","title":"RegressorInfo","text":"","category":"section"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"The RegressorInfo struct holds information about one regressor.","category":"page"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"Access functions are: regr_name, regr_coeff, and regr_se.","category":"page"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"scale_regressor can be used to rescale a regressor. It just multiplies coefficient and standard error by a scalar. ","category":"page"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"reduce_regr_infos applies a function, such as mean to all coefficients and standard errors in a vector of regression coefficients. This can be used to average regressions.","category":"page"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"RegressorInfo\nregr_name\nregr_coeff\nregr_se\nscale_regressor\nreduce_regr_infos","category":"page"},{"location":"index.html#EconometricsLH.RegressorInfo","page":"EconometricsLH","title":"EconometricsLH.RegressorInfo","text":"RegressorInfo\n\nHolds information about one regressor: name, coefficient, std error.\n\n\n\n\n\n","category":"type"},{"location":"index.html#EconometricsLH.regr_name","page":"EconometricsLH","title":"EconometricsLH.regr_name","text":"regr_name(ri)\n\n\nName of a regressor.\n\n\n\n\n\n","category":"function"},{"location":"index.html#EconometricsLH.regr_coeff","page":"EconometricsLH","title":"EconometricsLH.regr_coeff","text":"regr_coeff(ri)\n\n\nReturns the regression coefficient.\n\n\n\n\n\n","category":"function"},{"location":"index.html#EconometricsLH.regr_se","page":"EconometricsLH","title":"EconometricsLH.regr_se","text":"regr_se(ri)\n\n\nReturns the standard error.\n\n\n\n\n\n","category":"function"},{"location":"index.html#EconometricsLH.scale_regressor","page":"EconometricsLH","title":"EconometricsLH.scale_regressor","text":"scale_regressor(ri, scaleFactor)\n\n\nScale coefficient and std error (e.g. to change units).\n\n\n\n\n\n","category":"function"},{"location":"index.html#EconometricsLH.reduce_regr_infos","page":"EconometricsLH","title":"EconometricsLH.reduce_regr_infos","text":"reduce_regr_infos(rV, reduceFct)\n\n\nApplies reduceFct to vector of regression coefficients and std errors.\n\nReturns a RegressorInfo. Do not validate this. The user may call a function that does not return a valid RegressorInfo but is still useful.\n\nExample\n\nreduce_regr_infos([r1, r2, r3], sum)\n\n\n\n\n\n","category":"function"},{"location":"index.html#RegressionTable","page":"EconometricsLH","title":"RegressionTable","text":"","category":"section"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"A container for storing regression results (currently coefficients and their standard errors).","category":"page"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"The intended use cases are:","category":"page"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"One receives regression results generated outside of Julia and needs to store them, for example as target moments in an indirect inference problem.\nOne would like to store the results from regressions run with GLM.jl without storing the associated data, fitted values, etc.","category":"page"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"Regression tables are modified with add_regressor, drop_regressor!, change_regressor!, and rename_regressor.","category":"page"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"Regressors can be retrieved by name using get_regressor, where has_regressor checks whether a regressor exists. One can also directly retrieve regression coefficients using get_coefficient or standard errors with get_std_error. ","category":"page"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"A named collection of coefficients and standard errors is retrieved using get_coeff_se_multiple","category":"page"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"RegressionTable","category":"page"},{"location":"index.html#EconometricsLH.RegressionTable","page":"EconometricsLH","title":"EconometricsLH.RegressionTable","text":"RegressionTable\n\nHolds regression coefficients and std errors. The order is determined at construction.\n\n\n\n\n\n","category":"type"},{"location":"index.html#Retrieval","page":"EconometricsLH","title":"Retrieval","text":"","category":"section"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"get_regressor\nhas_regressor\nget_coefficient\nget_std_error\nget_coeff_se\nget_coeff_se_multiple\nget_all_coeff_se","category":"page"},{"location":"index.html#EconometricsLH.get_regressor","page":"EconometricsLH","title":"EconometricsLH.get_regressor","text":"get_regressor(rt, name)\n\nRetrieve a RegressorInfo object.\n\n\n\n\n\n","category":"function"},{"location":"index.html#EconometricsLH.has_regressor","page":"EconometricsLH","title":"EconometricsLH.has_regressor","text":"has_regressor(rt, name)\n\n\nDoes a regressor name exist in a RegressionTable?\n\n\n\n\n\n","category":"function"},{"location":"index.html#EconometricsLH.get_coefficient","page":"EconometricsLH","title":"EconometricsLH.get_coefficient","text":"get_coefficient(rt, name)\n\nReturn coefficient Coefficient name may be Symbol or String\n\n\n\n\n\n","category":"function"},{"location":"index.html#EconometricsLH.get_std_error","page":"EconometricsLH","title":"EconometricsLH.get_std_error","text":"get_std_error(rt, name)\n\n\nRetrieve a standard error by name.\n\n\n\n\n\n","category":"function"},{"location":"index.html#EconometricsLH.get_coeff_se","page":"EconometricsLH","title":"EconometricsLH.get_coeff_se","text":"get_coeff_se(rt, name)\n\nReturn coefficient and std error as tuple.  name can be Symbol or String.\n\n\n\n\n\n","category":"function"},{"location":"index.html#EconometricsLH.get_coeff_se_multiple","page":"EconometricsLH","title":"EconometricsLH.get_coeff_se_multiple","text":"get_coeff_se_multiple(rt, names)\n\nReturn multiple coefficients and std errors. names can be Symbol or String.\n\n\n\n\n\n","category":"function"},{"location":"index.html#EconometricsLH.get_all_coeff_se","page":"EconometricsLH","title":"EconometricsLH.get_all_coeff_se","text":"get_all_coeff_se(rt)\n\nReturn all coefficients and std errors.\n\n\n\n\n\n","category":"function"},{"location":"index.html#Modification","page":"EconometricsLH","title":"Modification","text":"","category":"section"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"add_regressor\ndrop_regressor!\nrename_regressor\nchange_regressor!","category":"page"},{"location":"index.html#EconometricsLH.add_regressor","page":"EconometricsLH","title":"EconometricsLH.add_regressor","text":"add_regressor(rt, name, coeff, se)\n\n\nAdd a regressor that does not already exist.\n\n\n\n\n\n","category":"function"},{"location":"index.html#EconometricsLH.drop_regressor!","page":"EconometricsLH","title":"EconometricsLH.drop_regressor!","text":"drop_regressor!(rt, name; errorOnMissing)\n\n\nDrop regressors by name. Option to ignore missing regressors instead of throwing an error.\n\n\n\n\n\n","category":"function"},{"location":"index.html#EconometricsLH.rename_regressor","page":"EconometricsLH","title":"EconometricsLH.rename_regressor","text":"rename_regressor(rt, oldName, newName)\n\n\nRename a regressor. Errors if oldName does not exist.\n\n\n\n\n\n","category":"function"},{"location":"index.html#EconometricsLH.change_regressor!","page":"EconometricsLH","title":"EconometricsLH.change_regressor!","text":"change_regressor!(rt, ri)\n\n\nChange regressor.\n\n\n\n\n\n","category":"function"},{"location":"index.html","page":"EconometricsLH","title":"EconometricsLH","text":"","category":"page"}]
